import React from "react";

import { Layout } from '../layout';
const Login = () => (
    <Layout>
        <div className='login'>
        <form className='login__form border border-purple'>
            <h1>Login Here</h1>
            <input type="name" placeholder="Name" />
            <input type="password" placeholder="Password" />
        </form>
        </div>
    </Layout>
);

export default Login;
